----Insert new values into generic table 
Declare @defCatId INT
SET @defCatId=(Select Top(1) categoryid from PHRM_MST_Category where CategoryName='N/A')

declare @mapTbl Table(genericName varchar(200))
Insert into @mapTbl
select  distinct genericname from PHRM_MAP_GenericDosaseNFreq
where genericid is null

declare @curGenName varchar(200)
While(EXISTS(Select 1 from @mapTbl))
BEGIN
 --- set current generic name into this variable--
 SET @curGenName= (Select TOP(1) genericname from @mapTbl)
 --- Insert new row in generic table--
--get current genericid--

   Declare @currGenId INT

  IF NOT EXISTS (SElect 1 from PHRM_MST_Generic where GenericName = @curGenName)
  BEGIN
    SET @currGenId = (Select MAX(GenericId) from PHRM_MST_Generic)+1
    Insert into PHRM_MST_Generic(GenericId,GenericName,CategoryId,IsAllergen,CreatedBy,CreatedOn,IsActive)
    Values(@currGenId, @curGenName,@defCatId,1,1,getdate(),1)
  END
  ELSE
  BEGIN
    SET @currGenId=(Select TOP (1) GenericId from PHRM_MST_Generic where GenericName=@curGenName)
  END

	--update map table with above genericid--
	UPDATE PHRM_MAP_GenericDosaseNFreq
	SET GenericId = @currGenId WHERE GenericName = @curGenName

 ---remove currentrow from temptable-- so that while loop won't run forever--
  Delete from @mapTbl where genericName = @curGenName
END
GO


